/*!

=========================================================
* Argon Design System React - v1.1.0
=========================================================

* Product Page: https://www.creative-tim.com/product/argon-design-system-react
* Copyright 2020 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/argon-design-system-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React from "react";
// nodejs library that concatenates classes
import classnames from "classnames";

// reactstrap components
import {
  Badge,
  Button,
  Card,
  CardBody,
  CardImg,
  FormGroup,
  Input,
  InputGroupAddon,
  InputGroupText,
  InputGroup,
  Container,
  Row,
  Col
} from "reactstrap";

// core components
import DemoNavbar from "components/Navbars/DemoNavbar.js";
import CardsFooter from "components/Footers/CardsFooter.js";

// index page sections
import Download from "../IndexSections/Download.js";

class Landing extends React.Component {
  state = {};
  componentDidMount() {
    document.documentElement.scrollTop = 0;
    document.scrollingElement.scrollTop = 0;
    this.refs.main.scrollTop = 0;
  }
  render() {
    return (
      <>
        <DemoNavbar />

        <main ref="main">

          {/* Contactanos */}
          <div id="fh5co-contact" classname="fh5co-contact-outer container-fluid">
            <h1 classname="mb-5">CONTÁCTANOS</h1>
            <hr/>
            <div classname="row p-3">
              <div classname="col-lg-8 wow fadeIn animated" data-wow-delay="0.25s">
                <form id="contact-form" action="#">
                  <div classname="row text-center">
                    <div classname="col-lg-6 mb-2 form-group">
                      <i classnam e="fa fa-user icon"></i>
                      <Input type="text" classname="form-control" placeholder="Ingrese su nombre"/>
                    </div>
                    <div classname="col-lg-6 mb-2 form-group">
                      <i classname="fa fa-envelope icon"></i>
                      <Input type="text" class="form-control" placeholder="Ingrese su email"/>
                    </div>
                  </div>
                  <div classname="form-group mt-2">
                    <i class="fa fa-pencil-alt icon"></i>
                    <input type="text" class="form-control" placeholder="Ingrese un asunto"/>
                  </div>
                  <div classname="form-group mt-2">
                    <textarea type="text" rows="5" class="form-control md-textarea" placeholder="Redacte su mensaje"></textarea>
                  </div>
                    <input type="submit" classname="button btn" value="Enviar"/>
                </form>
              </div>
              <div classname="col-lg-4 wow fadeIn animated text-center  mt-0 mb-0" data-wow-delay="0.25s">
                <img src="/img/breviLogo.PNG" alt="logo"/>
                <div classname="row mt-2 tarj">
                  <i classname="fas fa-phone mt-2"></i>
                  <p>(054) 426610</p>
                  <i classname="fas fa-envelope"></i>
                  <p>brevi@gmail.com</p>
                </div>
              </div>
            </div>
          </div>
          {/* End Contactanos */}

        </main>


        <CardsFooter />
      </>
    );
  }
}

export default Landing;
